import React from "react";
import "./App.css";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";
import ListRecord from "./component/Record/ListRecord";
import AddRecord from "./component/Record/AddRecord";

function App() {
  return (
    <div className="col-md-6">
      <div className="row">
        <a style={{ textDecoration: "none" }} href="/records">
          Records
        </a>
        <a
          style={{ textDecoration: "none", marginLeft: "2rem" }}
          href="/addRecord"
        >
          Add Records
        </a>
      </div>
      <Switch>
        <Route path="/records" component={ListRecord} />
        <Route path="/addRecord" component={AddRecord} />
      </Switch>
    </div>
  );
}

const style = {
  color: "red",
  margin: "10px",
};

export default App;
